import React, { Component } from 'react';
import {BrowserRouter,Switch,Route,Redirect} from "react-router-dom";
import './App.css';
import Navigation from './components/Navigation/Navigation';
import SkillsNavigation from './components/SkillsNavigation/SkillsNavigation';
import About from './components/Pages/About';
import ClinicalSkills from './components/Pages/ClinicalSkills';
import ContactUs from './components/Pages/ContactUs';
import OxygenTherapy from './components/Pages/OxygenTherapy';



class App extends Component {
  render (){
  return( 
    <div className = "App">     
<BrowserRouter>
  <React.Fragment>
    <Navigation />
    <SkillsNavigation />
    <main> 
    <Switch>
      <Redirect from ="/" to = "/About" exact/>
      <Route path= "/About" component ={About}/>
      <Route path= "/ClinicalSkills" component = {ClinicalSkills}/>
      <Route path= "/ContactUs" component ={ContactUs}/>
      <Route path= "/OyygenTherapy" component ={OxygenTherapy}/>
    </Switch>
    </main>
    </React.Fragment>
    </BrowserRouter>

    </div>
  );
}
}

export default App;
